import React from "react";
import Chamada from './chamada';
import Parceiros from './parceiros';
import './show.scss';

import { Link } from "react-router-dom";

const Show = props => {

  const {partners, current_event} = props
  const havePrice = true;

   return (
      <section id="ShowDestaque">
        <div className="showWrapper">
           <picture className="imgDestaque">
              {  current_event && current_event.cover_home_url &&
                <img src={current_event.cover_home_url} alt={current_event.name} />
              }
           </picture>
           <Chamada havePrice={havePrice} currentEvent={current_event}/>
        </div>
         <Parceiros partners={partners} />
      </section>
   );
};

export default Show;
